import React from 'react'
import "./Expenses.scss";
import ExpenseItem from "./ExpenseItem";

export default function Expenses({data}) {
  return (
    <div className="expenses">
          {expenses.map(expense => (
      <ExpenseItem data={data} />
      ))}
    </div>
  )
}
